    "2015-09-26T19:46:57.828293",nt"name": "h11618-nos-hydrographic-survey-in-the-vicinity-of-mississippi-sound-mississippi-2007",nt"isopen":
    false,nt"url": null,nt"notes": "The National Oceanic and Atmospheric Administration
    (NOAA) has the statutory mandate to collect hydrographic data in support of nautical
    chart compilation for safe navigation and to provide background data for engineers,
    scientific, and other commercial and industrial activities. Hydrographic survey
    data primarily consist of water depths, but may also include features (e.g. rocks,
    wrecks), navigation aids, shoreline identification, and bottom type information.
    NOAA is responsible for archiving and distributing the source data as described
    in this metadata record. This data set is located in the Mississippi Sound, between
    Long Beach and Biloxi. The date of collection was June 14, 2006 - March 18, 2007.
    The vessels used to collect this data were the High Roller, Hydro Surveyor, and
    Inland Surveyor. Soundings were collected by an Odom Hydrotrac Echosounder. The
    data were originally collected in meters, referenced to MLLW. The data were later
    converted to feet. The tidal data were processed using the 1983-2001 epoch. The
    NOAA Office for Coastal Management (OCM) downloaded the depth data for this survey
    from the NGDC website (http://www.ngdc.noaa.gov/mgg/bathymetry/hydro.html) as x,y,z
    points. The points were converted from MLLW depths to NAVD88 depths (using grid
    LAmobile02_8301;Louisiana/Mississippi - Eastern Louisiana to Mississippi Sound,
    Version 02 (1983-2001);0;1983-2001) using NOAA's Vertical Datum Transformation tool,
    VDatum (http://vdatum.noaa.gov/). The NAVD88 depths were then converted to ellipsoid
    depths (using the Geoid12a model), converted from x,y,z format to las format and
    classified as 11 (OCM bathymetry). Finally, the las files were zipped to laz format.",nt"license_title":
